import { repeaterData, RepeaterControl } from './gutenberg-repeater-control/index.js';

const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText, InspectorControls } = wp.blockEditor;
const {
  PanelBody,
  PanelRow,
  TextControl,
  TextareaControl
} = wp.components;

registerBlockType("gb/sidebyside", {
  title: __("Side by Side", "GB"),
  icon: (
    <img src="data:image/png;base64," />
  ),
  category: "faq",
  attributes: {
    hidden: {
      type: "string|array", // It's a string when persisted but when working on gutenberg it's an array
      source: "attribute",
      selector: "select",
      attribute: "hidden",
      default: [],
    },
    contentUA: { type: "string", default: `Frequently asked questions` },
    contentt: {
      type: "string",
      default: `What&#039;s the best thing about Switzerland?`,
    },
    contentUB: {
      type: "string",
      default: `I don&#039;t know, but the flag is a big plus. Lorem ipsum dolor sit amet consectetur adipisicing elit. Quas cupiditate laboriosam fugiat.`,
    },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <div className="bg-gray-50">
        <InspectorControls>
          <PanelBody title="Block settings">
            <PanelRow>
              <b>FAQ's</b>
            </PanelRow>
            <PanelRow>
              <RepeaterControl
                max={10}
                value={props.attributes.hidden}
                onChange={(val) => {
                  props.setAttributes({ hidden: val });
                }}
              >
                {(value, onChange) => {
                  return [
                    <TextControl
                      label="Question"
                      value={value.question}
                      onChange={(v) => {
                        value.question = v;
                        onChange(value);
                      }}
                    />,
                    <TextareaControl
                      label="Answer"
                      value={value.answer}
                      onChange={(v) => {
                        value.answer = v;
                        onChange(value);
                      }}
                    />,
                  ];
                }}
              </RepeaterControl>
            </PanelRow>
          </PanelBody>
        </InspectorControls>
        <div className="max-w-7xl mx-auto py-12 px-4 divide-y divide-gray-200 sm:px-6 lg:py-16 lg:px-8">
          
          <h2 className="text-3xl font-extrabold text-gray-900">
            <RichText
              value={attributes.contentUA}
              default={"Frequently asked questions"}
              onChange={(newtext) => setAttributes({ contentUA: newtext })}
            />
          </h2>
          <div className="mt-8">
            
            <dl className="divide-y divide-gray-200">
            {arData.map((v) => {
              return (
                <div className="pt-6 pb-8 md:grid md:grid-cols-12 md:gap-8">
                  <dt className="text-base font-medium text-gray-900 md:col-span-5">
                    {v.question}
                  </dt>
                  <dd className="mt-2 md:mt-0 md:col-span-7">
                    <p className="text-base text-gray-500">
                      {v.answer}
                    </p>
                  </dd>
                </div>
              )
            })}
            </dl>
          </div>
        </div>
      </div>
    );
  },
  save: function (props) {
    const { attributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <div class="bg-gray-50">
        
        <div class="max-w-7xl mx-auto py-12 px-4 divide-y divide-gray-200 sm:px-6 lg:py-16 lg:px-8">
          
          <h2 class="text-3xl font-extrabold text-gray-900">
           <RichText.Content value={attributes.contentUA}/>
          </h2>
          <div class="mt-8">
            
            <dl class="divide-y divide-gray-200">

            {arData.map((v) => {
              return (
                <div className="pt-6 pb-8 md:grid md:grid-cols-12 md:gap-8">
                  <dt className="text-base font-medium text-gray-900 md:col-span-5">
                    {v.question}
                  </dt>
                  <dd className="mt-2 md:mt-0 md:col-span-7">
                    <p className="text-base text-gray-500">
                      {v.answer}
                    </p>
                  </dd>
                </div>
              )
            })}

            </dl>
          </div>
        </div>
      </div>
    );
  },
});
